  if (position < 0 || position >= length) {
    throw Error('Position outside range');
  }
  const buffer = new ArrayBuffer(length);
  const int8View = new Int8Array(buffer, 0, length);
  int8View.set([value], position);
  return new DataView(buffer);
}

